Краткое описание: сообщение поступает от тахографа. Статус диагностики: FMI 4, отсутствует сигнал. Приоритетность: 3

Индикация при автомобиле в режиме остановки, только указание на неисправность;

указание по действиям не требуется.

Краткое описание: сообщение поступает от тахографа. Статус диагностики: FMI 8, сигнал ошибочный Приоритетность: 3

Индикация при автомобиле в режиме остановки, только указание на неисправность;

указание по действиям не требуется.
